import logo from './logo.svg';
import './App.css';
import React from 'react'

class App extends React.Component{

    // Constructor 
    constructor(props) {
        super(props);

        this.state = {
            agents: [],
            DataisLoaded: false
        };
    }

    componentDidMount() {
        fetch("/agents")
            .then((res) => res.json())
            .then((json) => {
                this.setState({
                    agents: json,
                    DataisLoaded: true
                });
                console.log(json);
                console.log(typeof json);
            })
    }

    render() {
        const { DataisLoaded, items } = this.state;
        if (!DataisLoaded) return <div>
            <h1> Please wait some time.... </h1> </div> ;

        return (
        <div className = "App">
            <h1> Fetch data from an api in reacts </h1>  
              <h1> {agents} </h1> {
                agents.map((agent) => ( 
                <ol key = { agent.id } >
                    agent_id: { agent.agent_id }, 
                    cur_pos: { agent.cur_pos }, 
                    angle: { agent.angle } ,
                    ag_color: { agent.color }
                    </ol>
                ))
            }
        </div>
    );
}
}


export default App;
